import './App.css';
import Login from './App/Components/Login/Login';
import history from './App/Components/history';
import { Router, Switch, Route } from 'react-router-dom'
function App() {
  function loginuser() {
    return (
      <Switch>
        <Route>
          <Login />

        </Route>
      </Switch>)
  }
  return (<Router history={history}>

    <div className="App">
      {loginuser}
    </div>
  </Router>

  );

}

export default App;
